import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, NavLink } from 'react-router-dom';
import Header from './../components/Header';
import Footer from './../components/Footer';
import './../starterstyles.css';
import SampleShare from './SampleShare';
import SampleCreateEdit from './SampleCreateEdit';

function SampleList () {


    return (
        <Router>
            <Header />
                <h2 className="title">Your Song Samples</h2>

                <div className="create-card">
                <NavLink to="/SampleCreateEdit" className="bright-button">Create Sample</NavLink>
                </div>

                <section className="sample">
                    <div className="card">
                        <div className="song-details">
                            <h3>Song Name</h3>
                            <p>Date Created</p>
                        </div>
                        <div class="button-group-container">
                            <nav>
                            <NavLink to="/SampleShare" className="button">Share</NavLink>
                            <button className="button">Preview</button>
                            <NavLink to="/SampleCreateEdit" className="bright-button">Edit</NavLink>
                            </nav>
                        </div>
                    </div>
                </section>

                <Routes>
                    <Route path="/" element={<SampleList />} />
                    <Route path="/SampleCreateEdit" element={<SampleCreateEdit />} />
                    <Route path="/SampleShare" element={<SampleShare />} />
                </Routes>

                <div className="create-card">
                <NavLink to="/SampleCreateEdit" className="bright-button">Create Sample</NavLink>
                </div>


            <Footer />
        </Router>
    );
}

export default SampleList;
